import React from 'react';
import Header from './components/Header';
import SharpenSection from './components/SharpenSection';
import TestimonialsSection from './components/TestimonialsSection';
import './styles/App.css';

function App() {
  return (
    <div className="app">
      <Header />
      <main>
        <SharpenSection />
        <TestimonialsSection />
      </main>
    </div>
  );
}

export default App;
